import React, { Component } from 'react';
import { users } from '../../model/store';

class Component2 extends Component {

    style = {
        textAlign: 'center'
    }

    render() {
        return (
            <div>
                <h1>component 2</h1>
                {users.map(user => <h4>{user.name}</h4>)}
            </div>
        );
    }
}

export default Component2;
